import styled from 'styled-components';

export const SignInContainer = styled.div`
    width: 37vw;
    display: flex;
    flex-direction: column;
    padding: 0 20px;
`;

export const Title = styled.h1`
    margin: 10px 0;
`;

export const ButtonContainer = styled.div`
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
`;
